INSERT INTO `bot` (`id`, `description`, `referencekey`) VALUES
(1, 'information', ''),
(2, 'qna', ''),
(3, 'Authenticate', 'A'),
(4, 'message-information', 'A'),
(5, 'purchase a plan/subscription', 'A'),
(6, 'bulk-message', 'A'),
(7, 'template-message', 'A'),
(8, 'channel-message', 'A'),
(9, 'contact-details', 'A'),
(10, 'email-configuration', 'A'),
(11, 'Flow of the website', 'A'),
(12, '1. Click on scanQR button to generate a QRcode. \n                                       \n2. Scan QR-code and then wait for sometime to Authenticate message.', '1'),
(13, '1. Enter valid mobile-number to send a message.  \n\n2. Enter image to send a image. video or Gif not a supported.', '2'),
(14, 'Click on your profile button on header, then click on the pay option from the dropdown list. You will be redirected to the subscription page for payment.\nWe have 5 plans. \n1. Basic Plan    (Monthly) Free\n2. Standard Plan (Monthly) of \nRs. 1000 \n3. Premium  Plan (Monthly) of \nRs. 2000  \n4. Standard Plan (Yearly)  of \nRs. 10000  \n5. Premium  Plan (Yearly)  of \nRs. 20000  \n\nTo buy a Plan: \n1. Go to the subscription page \n2. Select plan of your choice \n3. Click on Subscribe button \n4. Pay the amount of selected plan', '3'),
(15, 'The Google Sheet or Local CSV file must have column name of \'phone\' for mobile number, \'name\' for client name and \'email\' for email.\r\n\r\nNote: your Googlesheet have to need a permission setting as per requirnment.', '4'),
(16, 'Template message means Userwise bulk-message sending using a template with usernames and details of specific-user.\r\n\r\nCustom template means you can create your own template with the message you want. You also have to provide Userfields means number of columns you want to replace data with. you can create your custom template from custom-template page.', '5'),
(17, 'With the help of channel, you can group contacts into a single unit and send the message Individualy. use the channel afterwards to send the message or email to regular customers.', '6'),
(18, 'By storing contact details, you can avoid selecting Googlesheets or local csv file every time and can save your time by storing the contact details of the regular clients in the contact list.', '7'),
(19, 'To send email from your registered _email_ address, you have to create app password for your Gmail Account and set it as your *\'App password for Gmail\'*. \r\n\r\nfor more details, you have to follow the steps given on the Email Configuration page.', '8'),
(20, '1. First create an instance. \r\n\r\n2. Then go to that instance and scanQR code for Whatsapp. \r\n\r\n3. Select API of your choice and then send the appropriate message. \r\n\r\n4. If you want to send message from Googlesheet or local csv file, name of column for mobile number must be \'phone\' and for client names, it should be \'name\'. Other columns are allowed.', '9');
